import React from 'react';
import Sdata from './Sdata';
import Card from './Cards';

const Netflix =() => {
(
    <Card
        key={Sdata[0].id}
        imgscr={Sdata[0].imgscr}
        title={Sdata[0].title}
        sname={Sdata[0].sname}
        link={Sdata[0].links}
    />
)}

export default Netflix;
